      SELECT DISTINCT col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col2 * - col1 + - col1 * + col0 + col2 / + cor0.col1 NOT IN ( col1 ) OR NOT NULL NOT IN ( - col1 );
  - name: tab0

outputs:
  - name: q7771.out
    data: |
